import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

class Navbar extends Component{
    state={clicked: false};
    render(){
    return(
        <>
         <nav>
            <div>
                <ul id="navbar">
                    <li><a className="activeHome" href="index.html">Home</a></li>
                    <li><a href="index.html">Edit Information</a></li>
                    <li><a href="index.html">Upload Requirements</a></li>
                    <li><a href="index.html">Endorsement Letter</a></li>
                </ul>
            </div>

            <div id="mobile">
                <i id="bar" className={this.state.clicked?'fas-fa-time': "fa fas-bars"}></i>
            </div>
        </nav>
        </>
    )
}
}

export default Navbar;
